    <script>
function LatLng() {
  
  var latlng = document.querySelector("#combobox").value;
  var lat = parseFloat(latlng.split(",")[0]);
  var lng = parseFloat(latlng.split(",")[1]);
  
  var infowindow = new google.maps.InfoWindow({
   content:'<IMG SRC="https://github.com/biglan-1234/googlemap/blob/master/HERE1.png?raw=true" width=30px height=30px>',
    
    position: {
      lat: lat,
      lng: lng
    },
    pixelOffset: new google.maps.Size(0, -30) ,
  });
 
  infowindow.open(map);
  
  
  
  
  
}
</script>

    <script>
var x = document.getElementById("option_value");
function getLocation() {
  if (navigator.geolocation) {
    navigator.geolocation.watchPosition(showPosition,showError,options);
  } else {
    x.innerHTML = "Geolocation is not supported by this browser.";
  }
}

function showPosition(position) {
  x.value = position.coords.latitude +','+ position.coords.longitude;
}
      
function showError(error) {
  switch(error.code) {
    case error.PERMISSION_DENIED:
      x.innerHTML = "使用者拒絕存取."
      break;
    case error.POSITION_UNAVAILABLE:
      x.innerHTML = "Location information is unavailable."
      break;
    case error.TIMEOUT:
      x.innerHTML = "The request to get user location timed out."
      break;
    case error.UNKNOWN_ERROR:
      x.innerHTML = "An unknown error occurred."
      break;
  }
}     
    
      var options = {
  enableHighAccuracy: true
  
};
      
</script>
